  \"An investigation of contaminant impacts to watercress darter, Etheostama nuchale,
  habitat at Roebuck Springs, Thomas' Spring, and Glenn Springs, Jefferson Country,
  Alabama\",\n\t\"tracking_summary\": {\n\t\t\"total\": 9,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:40.856913\",\n\t\"name\":
  \"an-investigation-of-contaminant-impacts-to-watercress-darter-etheostama-nuchale-habitat-at\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a study with the
  following results: 1. Roebuck Springs was the only site found with contaminant loading
  with PAH's at levels suspected of being harmful to the watercress darter. Residue
  levels in snail tissue were considerably less than found in sediments indicating
  a modest level of biotic uptake. 2. The primary source of PAH's into Roebuck Springs
  was a large diameter stormwater drainage pipe discharging into the upper reach of
  the spring run. Elevated levels were also found in the spring run immediately below
  the mouth of an unnamed tributary indicating this as a secondary source. The parking
  lot below the tennis courts is another suspected secondary source. 3. Chlorinated
  hydrocarbon pesticides were not found above analytical detection limits in Roebuck
  Springs which was the spring suspected of having the greatest potential for pesticide
  impacts. 4. Microtox bioassays of sediment pore water samples did not indicate any
  appreciable level of toxicity. However, this should be interpreted as a limited
  assessment and not a conclusive toxicity evaluation. 5. Histopathological examinations
  of watercress darters collected from Roebuck Springs did not indicate any evidence
  of tumor formation. However, two of the fish were found with megalocytic hepatocytes
  which have been found to be precursors of neoplasia in other species of fish. 6.
  Cadmium and lead levels were elevated in Roebuck Springs sediments, yet low to non-detectable
  concentrations in snail tissue indicated minimum bioavailability. 7. There were
  no observed commercial or municipal point source discharges into any of the three
  springs.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
